                    "$type": "Asi.Soa.Communications.DataContracts.CommunicationMessageTemplateTextData, Asi.Contracts",
                    "TemplateText": "<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n    <head>\r\n        <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n        <title>iMIS Software</title>\r\n        <style type=\"text/css\" media=\"screen\">\r\n            body {\r\n            background-color: #dbdbdb;\r\n            }\r\n            a img {\r\n            border: none;\r\n            }\r\n            table.bg1 {\r\n            background-color: #dbdbdb;\r\n            font-family: Segoe UI, Helvetica Neue, Arial, sans-serif;\r\n            }\r\n            td.body {\r\n            padding: 15px 15px 15px 15px;\r\n            background-color: #ffffff;\r\n            text-align:left;\r\n            color: #424242;\r\n            font-family: Segoe UI, Helvetica Neue, Arial, sans-serif;\r\n            font-size: 14px;\r\n            line-height: 16px;\r\n            font-weight: normal;\r\n            color: #424242;\r\n            line-height: 16px;\r\n            min-height:200px;\r\n            height:200px;\r\n            }\r\n            td.body h1, h2, h3 {\r\n            color: #424242;\r\n            margin: 0;\r\n            padding: 5 0 0 0;\r\n            }\r\n            td.header {\r\n            background-color: #ffffff;\r\n            }\r\n            td.footer {\r\n            padding: 10px 20px 5px 20px;\r\n            background-color: #424242;\r\n            height: 75px;\r\n            font-family: Segoe UI, Helvetica Neue, Arial, sans-serif;\r\n            font-size: 11px;\r\n            font-weight: normal;\r\n            color: #ffffff;\r\n            line-height: 16px;\r\n            }\r\n            td.footer p {\r\n            margin: 0;\r\n            padding: 0;\r\n            }\r\n            td.footer h4 {\r\n            font-family: Segoe UI, Helvetica Neue, Arial, sans-serif;\r\n            font-size: 17px;\r\n            font-weight: normal;\r\n            color: #ffffff;\r\n            line-height: 18px;\r\n            margin: 0;\r\n            padding-bottom: 10px;\r\n            }\r\n            td.footer a {\r\n            color: #0066CC;\r\n            }\r\n        </style>\r\n    </head>\r\n    <body style=\"overflow-y: auto !important;\">\r\n        <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"bg1\">\r\n            <tbody>\r\n                <tr>\r\n                    <td align=\"center\">\r\n                    <table width=\"700\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" class=\"bg1\" style=\"font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; background-color: #dbdbdb;\">\r\n                        <tbody>\r\n                            <tr>\r\n                                <td align=\"left\" class=\"header\" style=\"background-color: #ffffff;\">\r\n                                <img src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/head_imis_700_whiteongrey.gif\" alt=\"iMIS Software\" />\r\n                                </td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td valign=\"top\" class=\"body\" style=\"padding: 15px; color: #424242; font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; font-size: 14px; line-height: 16px; font-weight: normal; min-height: 200px; height: 200px; background-color: #ffffff;\">\r\n                                <!-- Main Content here -->\r\n                                <p>Dear {#party.FirstName},</p>\r\n                                <p>Thank you for attending our <strong>{#iqa.code_EventTitle}</strong>! We hope you enjoyed\r\n                                networking with your peers and interacting with our knowledgeable speakers.</p>\r\n                                Looking for more career-enhancing opportunities? Check out our website for more engaging event opportunities. Use\r\n                                promo code <strong>SpecialDiscount</strong>&nbsp;for 10% off your registration!\r\n                                <p>[INSERT LINK TO EVENT LIST]</p>\r\n                                </td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td valign=\"middle\" align=\"left\" class=\"footer\" style=\"padding: 10px 20px 5px; height: 75px; font-size: 11px; font-weight: normal; color: #ffffff; line-height: 16px;\">\r\n                                <table width=\"660\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n                                    <tbody>\r\n                                        <tr>\r\n                                            <td valign=\"middle\" style=\"width: 80%;\">\r\n                                            <h4 style=\"font-size: 17px; font-weight: normal; color: #ffffff; line-height: 18px; margin: 0px; padding-bottom: 10px;\">Connect with us:  &nbsp;\r\n                                            <a href=\"http://www.facebook.com/advsol\" style=\"color: #0066cc;\"><img alt=\"Facebook\" src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/facebook_icon.gif\" style=\"border: none;\" /></a>    &nbsp;\r\n                                            <a href=\"http://twitter.com/#!/advsol\" target=\"_blank\" style=\"font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; font-size: 11px; font-weight: normal; color: #0066cc; line-height: 16px; margin: 0px; padding: 0px;\"><img alt=\"Twitter\" src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/twitter_icon.gif\" style=\"border: none;\" /></a>    &nbsp;\r\n                                            <a href=\"http://www.linkedin.com/company/advanced-solutions-international-inc.\" target=\"_blank\" style=\"font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; font-size: 11px; font-weight: normal; color: #0066cc; line-height: 16px; margin: 0px; padding: 0px;\"><img alt=\"LinkedIn\" src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/linkedin_icon.gif\" style=\"border: none;\" /></a>\r\n                                            &nbsp;\r\n                                            <a href=\"http://www.youtube.com/user/asicommunity\" style=\"font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; font-size: 11px; font-weight: normal; color: #0066cc; line-height: 16px; margin: 0px; padding: 0px;\"><img alt=\"YouTube\" src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/youtube_icon.gif\" style=\"border: none;\" /></a>  &nbsp;\r\n                                            <a href=\"https://plus.google.com/u/0/107863455837883513021/posts\" style=\"font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif; font-size: 11px; font-weight: normal; color: #0066cc; line-height: 16px; margin: 0px; padding: 0px;\"><img alt=\"\" src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/googleplus_icon.gif\" style=\"border: none;\" /></a>\r\n                                            </h4>\r\n                                            </td>\r\n                                            <td valign=\"top\" style=\"width: 20%;\">\r\n                                            </td>\r\n                                        </tr>\r\n                                    </tbody>\r\n                                </table>\r\n                                <p>This email was sent to <strong>{#party.Email}</strong>. </p>\r\n                                <p><strong>Advanced Solutions International</strong> is located at 901 N Pitt St, Alexandria, VA\r\n                                22314.</p>\r\n                                </td>\r\n                            </tr>\r\n                            <tr>\r\n                                <td>\r\n                                <a href=\"http://www.advsol.com\" class=\"Footer ASI Link\"><img src=\"http://www.advsol.com/asi/images/CommunicationsTemplates/asi_logo_lowerbanner_grey_700w.gif\" alt=\"Advanced Solutions\r\n                                International\" style=\"border: none;\" /></a>\r\n                                </td>\r\n                            </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    </td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </body>\r\n</html>",
